import React, { useState } from "react";
import "./Profile.css";

const Profile = () => {
  const [user, setUser] = useState({
    name: "John Doe",
    age: 25,
    bio: "Love music, movies, and coffee!",
    image: "https://randomuser.me/api/portraits/men/10.jpg",
    interests: ["Music", "Travel", "Gaming"],
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setUser({ ...user, [name]: value });
  };

  const handleAddInterest = () => {
    const interest = prompt("Enter new interest:");
    if (interest) setUser({ ...user, interests: [...user.interests, interest] });
  };

  return (
    <div className="profile-page">
      <div className="profile-card">
        <img src={user.image} alt={user.name} className="profile-pic" />
        <div className="profile-info">
          <h2>{user.name}, {user.age}</h2>
          <p>{user.bio}</p>
          <div className="interests">
            {user.interests.map((i, idx) => (
              <span key={idx} className="badge">{i}</span>
            ))}
            <button className="add-btn" onClick={handleAddInterest}>+ Add</button>
          </div>
        </div>
      </div>

      <div className="edit-profile">
        <h3>Edit Profile</h3>
        <input type="text" name="name" value={user.name} onChange={handleChange} placeholder="Name" />
        <input type="number" name="age" value={user.age} onChange={handleChange} placeholder="Age" />
        <textarea name="bio" value={user.bio} onChange={handleChange} placeholder="Bio"></textarea>
      </div>
    </div>
  );
};

export default Profile;
